import { axios } from "axios"
import { useEffect, useState } from "react"
import { styled } from "styled-components"

export default function Feed(){
    const url = `http://localhost:5000`
const [postagens, setPostagens]=useState([])

useEffect(()=> {
    const feedtotal = axios.get(`${url}/feed`)
    feedtotal.then((res)=> setPostagens(res.data))
    feedtotal.catch((err)=> console.log(err.response.data))
}, [])

    return <MeuFeedEstilizado>   <PostsPerfil>
    {postagens.map((post)=> (
        <UnidadePost
        foto={post.foto_post}
        descrição={post.descrição}
        id={post.id}
        />
    ))}

</PostsPerfil></MeuFeedEstilizado>
}



const MeuFeedEstilizado = styled.main` 
width: 100%;
height: 90%;
display: flex;
flex-direction: column;
align-items: center;
justify-content: space-evenly;
h1{
    color: black;
}
position: relative
`
